    Analyze data using comprehensive statistical software



    Receive answers spreadsheets and databases can't give you. SPSS 12.0

    for Windows provides you with a broad range of capabilities for the

    entire analytical process. With SPSS, you can generate decision-making

    information quickly using powerful statistics, understand and

    effectively present your results with high-quality tabular and

    graphical output, and share your results with others using a variety of 

    reporting methods, including secure Web publishing. All this empowers

    you to make smarter decisions more quickly by uncovering key facts,

    patterns and trends.



    For more than 35 years, people like you have used SPSS for data mining 

    and database analysis, market and survey research, and research of all

    types because SPSS is the best software for solving business and

    research problems using statistics. 



